import React from "react";
import {
  FaEnvelope,
  FaPhone,
  FaMapMarkerAlt,
  FaFacebook,
  FaInstagram,
  FaLinkedin,
  FaTwitter,
  FaWhatsapp,
} from "react-icons/fa";

const Footer = () => {
  return (
    <>
      <style>{`
        .footer-container {
          background-color: #0b1033;
          color: #f1f1f1;
          padding-top: 40px;
          font-family: Arial, sans-serif;
        }

        .footer-title {
          text-align: center;
          font-size: 2rem;
          font-weight: bold;
          color: #ffffff;
          margin-bottom: 24px;
        }

        .associates-logos {
          display: flex;
          justify-content: center;
          align-items: center;
          flex-wrap: wrap;
          background-color: #151a4a;
          padding: 24px 0;
          gap: 40px;
        }

        .associates-logos img {
          height: 40px;
          filter: brightness(0) invert(1);
        }

        .footer-content {
          background: linear-gradient(to right, #0b1033, #1a1f50);
          padding: 40px 16px;
          display: grid;
          grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
          gap: 40px;
        }

        .footer-logo img {
          height: 64px;
          margin-bottom: 16px;
          filter: brightness(0) invert(1);
        }

        .footer-section h3 {
          font-weight: bold;
          font-size: 18px;
          color: #ffffff;
          margin-bottom: 16px;
        }

        .footer-section ul {
          list-style: none;
          padding: 0;
          color: #d1d1d1;
        }

        .footer-section li {
          margin-bottom: 12px;
          display: flex;
          align-items: flex-start;
          gap: 8px;
          line-height: 1.4;
        }

        .footer-socials {
          display: flex;
          justify-content: center;
          gap: 24px;
          padding: 30px 0 40px;
          background-color: #0b1033;
        }

        .footer-socials svg {
          font-size: 24px;
          color: #d1d1d1;
          cursor: pointer;
          transition: color 0.3s ease;
        }

        .footer-socials .fa-facebook:hover { color: #1877f2; }
        .footer-socials .fa-instagram:hover { color: #e1306c; }
        .footer-socials .fa-linkedin:hover { color: #0077b5; }
        .footer-socials .fa-twitter:hover { color: #1da1f2; }
        .footer-socials .fa-whatsapp { color: #25d366; font-size: 28px; }
      `}</style>

      <div className="footer-container">
        <div className="footer-title">Associated With</div>

        <div className="associates-logos">
          <img src="/logos/boostmysites.png" alt="Boost My Sites" />
          <img src="/logos/technext.png" alt="Technext Solutions" />
          <img src="/logos/venteskraft.png" alt="Venteskraft" />
          <img src="/logos/quantumsoft.png" alt="Quantumsoft" />
          <img src="/logos/cybershield.png" alt="Cybershield" />
        </div>

        <div className="footer-content">
          <div className="footer-logo">
            <img src="/logos/aiwebx.png" alt="AI WebX Logo" />
          </div>

          <div className="footer-section">
            <h3>Our Services</h3>
            <ul>
              <li>Web Development</li>
              <li>App Development</li>
              <li>AI & ML Development</li>
              <li>Blockchain Solutions</li>
              <li>Cloud Computing Services</li>
              <li>VR & AR Development</li>
            </ul>
          </div>

          <div className="footer-section">
            <h3>Contact Info</h3>
            <ul>
              <li><FaEnvelope /> info@aiwebx.in</li>
              <li><FaPhone /> +91 63013 50318</li>
              <li><FaMapMarkerAlt /> 10-47 Ambedkar Nagar, Jawaharnagar, Turmalagiri, Hyderabad - 500087, Telangana, India</li>
            </ul>
          </div>
        </div>

        <div className="footer-socials">
          <FaFacebook className="fa-facebook" />
          <FaInstagram className="fa-instagram" />
          <FaLinkedin className="fa-linkedin" />
          <FaTwitter className="fa-twitter" />
          <FaWhatsapp className="fa-whatsapp" />
        </div>
      </div>
    </>
  );
};

export default Footer;
